import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../utils/api';

const DashboardPage = () => {
  const [organisations, setOrganisations] = useState([]);
  const [searchResults, setSearchResults] = useState([]);
  const [requestedOrgs, setRequestedOrgs] = useState([]);
  const [selectedOrg, setSelectedOrg] = useState('');
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchOrganisations = async () => {
      try {
        const { data } = await API.get('/users/me', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });

        setOrganisations(data.organisations || []);
        setRequestedOrgs(data.accessRequests || []);
      } catch (err) {
        console.error(err);
      }
    };

    fetchOrganisations();
  }, []);

  const handleSearch = async () => {
    try {
      const { data } = await API.get(`/organisations/search?query=${searchQuery}`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
      });
      setSearchResults(data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleRequestAccess = async (orgId) => {
    try {
      await API.post(
        '/users/request-access',
        { orgId, userId: JSON.parse(localStorage.getItem('user'))._id },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        }
      );
      alert('Access request sent');
      setSearchResults((prevResults) =>
        prevResults.map((org) =>
          org._id === orgId ? { ...org, requested: true } : org
        )
      );
    } catch (err) {
      console.error(err);
    }
  };

  const handleSelectOrganisation = () => {
    if (selectedOrg) {
      navigate(`/organisation/${selectedOrg}`);
    } else {
      alert('Please select an organisation');
    }
  };

  return (
    <div className="p-4 bg-gray-50 min-h-screen">
      <h1 className="text-2xl font-semibold text-gray-800 mb-6">Dashboard</h1>

      {organisations.length > 0 ? (
        <div className="mb-6">
          <label className="block mb-2 text-sm font-medium text-gray-700">
            Select an Organisation
          </label>
          <select
            className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500"
            value={selectedOrg}
            onChange={(e) => setSelectedOrg(e.target.value)}
          >
            <option value="">-- Select Organisation --</option>
            {organisations.map((org) => (
              <option key={org.orgId._id} value={org.orgId._id}>
                {org.orgId.name}
              </option>
            ))}
          </select>
          <button
            onClick={handleSelectOrganisation}
            disabled={!selectedOrg}
            className={`mt-3 w-full py-2 rounded text-sm font-medium ${
              selectedOrg
                ? 'bg-blue-600 text-white hover:bg-blue-700'
                : 'bg-gray-300 text-gray-600 cursor-not-allowed'
            } transition duration-300`}
          >
            Go to Organisation
          </button>
        </div>
      ) : (
        <p className="text-sm font-medium text-gray-600 mb-4">
          You are not part of any organisation yet. Create or search for one below!
        </p>
      )}

      <div className="bg-white shadow-sm rounded p-4 mb-6">
        <h2 className="text-lg font-bold text-gray-700 mb-4">
          Search for Organisations
        </h2>
        <div className="flex gap-2 mb-4">
          <input
            type="text"
            placeholder="Search organisations..."
            className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <button
            onClick={handleSearch}
            className="bg-blue-600 text-white px-4 py-2 rounded text-sm font-medium hover:bg-blue-700 transition duration-300"
          >
            Search
          </button>
        </div>
        <ul className="space-y-2">
          {searchResults.map((org) => (
            <li
              key={org._id}
              className="p-3 bg-gray-100 border rounded shadow-sm flex justify-between items-center"
            >
              <span className="text-sm font-medium text-gray-700">{org.name}</span>
              <button
                onClick={() => handleRequestAccess(org._id)}
                disabled={org.requested}
                className={`px-3 py-1 rounded text-sm font-medium ${
                  org.requested
                    ? 'bg-gray-300 text-gray-600 cursor-not-allowed'
                    : 'bg-green-600 text-white hover:bg-green-700'
                } transition duration-300`}
              >
                {org.requested ? 'Request Sent' : 'Request Access'}
              </button>
            </li>
          ))}
        </ul>
      </div>

      {requestedOrgs.length > 0 && (
        <div className="bg-white shadow-sm rounded p-4 mb-6">
          <h2 className="text-lg font-bold text-gray-700 mb-4">Requested Organisations</h2>
          <ul className="space-y-2">
            {requestedOrgs.map((org) => (
              <li
                key={org.orgId._id}
                className="p-3 bg-gray-100 border rounded shadow-sm"
              >
                <span className="text-sm font-medium text-gray-700">
                  {org.orgId.name} (Pending)
                </span>
              </li>
            ))}
          </ul>
        </div>
      )}

      <button
        onClick={() => navigate('/create-organisation')}
        className="w-full bg-blue-600 text-white py-2 rounded font-medium text-sm hover:bg-blue-700 transition duration-300"
      >
        Create Organisation
      </button>
    </div>
  );
};

export default DashboardPage;
